  `poundage` decimal(10,2) DEFAULT NULL COMMENT '手续费',
  `pay_type` tinyint(1) DEFAULT NULL COMMENT '支付类型',
  `create_time` int(11) DEFAULT NULL COMMENT '申请时间',
  `update_time` int(11) DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='充值表';

