-- ----------------------------
-- Table structure for `t_user`
-- ----------------------------
DROP TABLE IF EXISTS `t_user`;
CREATE TABLE `t_user` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '用户id',
  `parent_id` int(11) DEFAULT '0' COMMENT '上级用户id',
  `nick_name` varchar(32) DEFAULT NULL COMMENT '昵称',
  `uid` int(11) DEFAULT '0' COMMENT '用户UID',
  `unionid` varchar(32) CHARACTER SET utf8 NOT NULL COMMENT '微信号',
  `head` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '用户头像',
  `sign` varchar(1000) DEFAULT NULL COMMENT '个性签名',
  `area` char(20) CHARACTER SET utf8 DEFAULT NULL COMMENT '地区',
  `login_name` varchar(32) CHARACTER SET utf8 DEFAULT NULL COMMENT '登录账号',
  `user_level` tinyint(3) DEFAULT '0' COMMENT '用户等级',
  `recommend_id` int(11) DEFAULT NULL COMMENT '推荐人id',
  `password` char(32) CHARACTER SET utf8 DEFAULT NULL COMMENT '密码，必须md5加密',
  `sex` tinyint(1) DEFAULT NULL COMMENT '用户性别  1男 2女  0未知',
  `account_balance` decimal(20,8) DEFAULT '0.00000000' COMMENT '账户余额',
  `hb_shares` decimal(20,8) DEFAULT NULL COMMENT '红包股',
  `tel` varchar(12) CHARACTER SET utf8 DEFAULT NULL COMMENT '用户手机号',
  `register_date` int(11) DEFAULT NULL COMMENT '注册时间',
  `register_ip` varchar(16) CHARACTER SET utf8 DEFAULT NULL COMMENT '注册地点ip',
  `last_login_ip` varchar(16) CHARACTER SET utf8 DEFAULT NULL COMMENT '上一次登录的ip',
  `last_login_time` int(11) DEFAULT NULL COMMENT '最近一次登录时间',
  `account_state` tinyint(1) DEFAULT '1' COMMENT '账号状态, 1启用 2禁用',
  `is_del` tinyint(1) DEFAULT '0' COMMENT '是否删除，0未删除，1已删除',
  `device` tinyint(2) DEFAULT '0' COMMENT '用户设备  1安卓   2ios  3 h5',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='用户信息表';

