INSERT INTO `t_banner` VALUES ('103', 'app_index', '1', '0', '0', '0', 'activity_app', '38', '501', '【词目】文章\r\n【拼音】wén zhāng\r\n【注音】ㄨㄣˊ ㄓㄤ\r\n【基本解释】篇幅不很长而独立成篇的文字。\r\n“文章”的“章”字，是个会意字，从音从十。古代奏音乐，连奏十段才能结束（十，数之终也），这十段乐就是一章。所以，文章文章，也有段落。文章既从“音乐”里会意出来，应是用文字表达出来的东西，读起来如音乐一样美妙无穷、悦耳动听的文字，传诵开来，才配得上“文章”一词的真正含义。\r\n释义\r\n“文”即“纹”，指“纹路”、“纹样”。“章”本指“屏蔽”，转指“外表”。“文章”原义指“有纹样的表面”，诸如服装上', '99', '0', '1528945324', '0', '1528945324', '0', '1');
INSERT INTO `t_banner` VALUES ('104', 'app_index', '2', '0', '0', '0', 'activity_app', '42', '502', '“文”即“纹”，指“纹路”、“纹样”。“章”本指“屏蔽”，转指“外表”。“文章”原义指“有纹样的表面”，诸如服装上绣绘的龙凤图样、皮肤上针刺的花卉图案，等等。即其原义是指直接构成视觉形象的图样。后指文字所描绘出来的事物图样，需要大脑“解码”才能完整呈现的间接的事物形象。\r\n⑴原指文辞，现从写作的角度与“文学”区分，指篇幅不很长而独立成篇的文字。柳宗元的画像\r\n西汉·司马迁《史记·儒林列传》：“文章尔雅，训词深厚。”你看了晨报上的那篇文章了么？\r\n清田兰芳《明河南参政袁公墓志铭》：“公（袁可立子袁枢）实出于', '99', '0', '1528945372', '0', '1528945372', '0', '1');
